import React from "react";
const contact =()=>{
    return(
     <>
        <div className="contact-wrp">
            <div className="container">
                <div class="call-us-section text-center">
                <h4 class="m-b15">Let's work together</h4>
                <h2 class="call-us-number m-b15 m-b0">(+91)-7314995740</h2>
                <h2 class="call-us-number m-b15 m-b0">info@tiarainfrastructure.com</h2>
                <h4 class="call-us-address m-t0 m-b20">Tiara House, 782 Sai Kripa Colony Indore (M.P) - 452010</h4>
                <a href="contact.php" class="site-button-secondry btn-effect bg-dark get-in-btn">Contact Us</a>
                </div>
            </div>
        </div>
     </>
    )
}
export default contact;
